  `id` int NOT NULL AUTO_INCREMENT,
  `member_id` int NOT NULL COMMENT '用户ID',
  `market_id` int NOT NULL COMMENT '交易对ID',
  `stop_surplus` decimal(21,6) DEFAULT '0.000000' COMMENT '止盈金额',
